043d \u043f\u0440\u043e\u0432\u043e\u0437\u0433\u043b\u0430\u0441\u0438\u043b \u0432\u0435\u0440\u043d\u043e\u0441\u0442\u044c, \u043c\u0438\u0440, \u0447\u0435\u0441\u0442\u044c, \u043d\u0440\u0430\u0432\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0441\u0442\u044c \u0438 \u043c\u0443\u0436\u0435\u0441\u0442\u0432\u043e. \u041f\u0435\u0440\u0432\u044b\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B5%D1%80%D0%B5%D0%BD%D1%82%D0%B8%D0%BD%D1%81%D0%BA%D0%B8%D0%B5_%D0%B8%D0%B3%D1%80%D1%8B\" title=\"\u0422\u0435\u0440\u0435\u043d\u0442\u0438\u043d\u0441\u043a\u0438\u0435 \u0438\u0433\u0440\u044b\">\u0441\u0435\u043a\u0443\u043b\u044f\u0440\u043d\u044b\u0435 \u0438\u0433\u0440\u044b<\/a>&#160;\u2014 \u043f\u0440\u0430\u0437\u0434\u043d\u0438\u043a \u0436\u0435\u0440\u0442\u0432\u043e\u043f\u0440\u0438\u043d\u043e\u0448\u0435\u043d\u0438\u044f \u043f\u043e\u0434\u0437\u0435\u043c\u043d\u044b\u043c \u0431\u043e\u0433\u0430\u043c&#160;\u2014 \u0441\u043e\u0441\u0442\u043e\u044f\u043b\u0438\u0441\u044c \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/249_%D0%B3%D0%BE%D0%B4_%D0%B4%D0%BE_%D0%BD._%D1%8D.\" title=\"249 \u0433\u043e\u0434 \u0434\u043e \u043d. \u044d.\">249&#160;\u0433. \u0434\u043e&#160;\u043d.&#160;\u044d.<\/a> \u0432\u043e \u0432\u0440\u0435\u043c\u044f \u043f\u0435\u0440\u0432\u043e\u0439 \u041f\u0443\u043d\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u0432\u043e\u0439\u043d\u044b \u0438 \u0434\u043e\u043b\u0436\u043d\u044b \u0431\u044b\u043b\u0438 \u0437\u0430\u0442\u0435\u043c \u043f\u043e\u0432\u0442\u043e\u0440\u044f\u0442\u044c\u0441\u044f \u043a\u0430\u0436\u0434\u044b\u0435 \u0441\u0442\u043e \u043b\u0435\u0442, \u043d\u043e \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/49_%D0%B3%D0%BE%D0%B4_%D0%B4%D0%BE_%D0%BD._%D1%8D.\" title=\"49 \u0433\u043e\u0434 \u0434\u043e \u043d. \u044d.\">49 \u0433. \u0434\u043e&#160;\u043d.&#160;\u044d.<\/a> \u043d\u0435 \u0441\u043e\u0441\u0442\u043e\u044f\u043b\u0438\u0441\u044c \u0438\u0437-\u0437\u0430 \u04