u0441\u0442\u0438\u043b\u0438\u044f \u0438 \u041b\u0435\u043e\u043d\">\u041a\u0430\u0441\u0442\u0438\u043b\u0438\u0438 \u0438 \u041b\u0435\u043e\u043d\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1298_%D0%B3%D0%BE%D0%B4\" title=\"1298 \u0433\u043e\u0434\">1298<\/a>&#160;\u2014 \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%80%D0%B0%D0%B6%D0%B5%D0%BD%D0%B8%D0%B5_%D0%BF%D1%80%D0%B8_%D0%A2%D1%80%D0%B5%D0%B9%D0%B4%D0%B5%D0%BD%D0%B5\" title=\"\u0421\u0440\u0430\u0436\u0435\u043d\u0438\u0435 \u043f\u0440\u0438 \u0422\u0440\u0435\u0439\u0434\u0435\u043d\u0435\">\u0421\u0440\u0430\u0436\u0435\u043d\u0438\u0435 \u043f\u0440\u0438 \u0422\u0440\u0435\u0439\u0434\u0435\u043d\u0435<\/a> \u043c\u0435\u0436\u0434\u0443 \u0432\u043e\u0439\u0441\u043a\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D0%B2%D0%BE%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D0%BE%D1%80%D0%B4%D0%B5%D0%BD\" title=\"\u041b\u0438\u0432\u043e\u043d\u0441\u043a\u0438\u0439 \u043e\u0440\u0434\u0435\u043d\">\u041b\u0438\u0432\u043e\u043d\u0441\u043a\u043e\u0433\u043e \u043e\u0440\u0434\u0435\u043d\u0430<\/a> \u0438 \u0432\u043e\u0439\u0441\u043a\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B5_%D0%BA%D0%BD%D1%8F%D0%B6%D0%B5%D1%81%D1%82%D0%B2%D0%BE_%D0%9B%D0%B8%D1%82%D0%BE%D0%B2%D1%81%D0%BA%D0%BE%D0%B5\" title=\"\u0412\u0435\u043b\u0438\u043a\u043e\u0435 \u043a\u043d\u044f\u0436\u0435\u0441\u0442\u0432\u043e \u041b\u0438\u0442\u043e\u0432\u0441\u043a\u043e\u0435\">\u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u043a\u043d\u044f\u0436\u0435\u0441\u0442\u0432\u0430 \u041b\u0438\u0442\u043e\u0432\u0441\u043a\u043e\u0433\u043e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1479_%D0%B3%D0%BE%D0%B4\" title=\"1479 \u0433\u043e\u0434\">1479<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BF%D0%B5%D0%BD%D0%B3%D0%B0%D0%B3%D0%B5%D0%BD\" title=\"\u041a\u043e\u043f\u0435\u043d\u0433\u0430\u0433\u0435\u043d\">\u041a\u043e\u043f\u0435\u043d\u0433\u0430\u0433\u0435\u043d\u0435<\/a> \u043e\u0442\u043a\u0440\u044b\u0442 \u043f\u0435\u0440\u0432\u044b\u0439 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0414\u0430\u043d\u0438\u044f\">\u0414\u0430\u043d\u0438\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BF%D0%B5%D0%BD%D0%B3%D0%B0%D0%B3%D0%B5%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D1%83%D0%BD%D0%B8%D0%B2%D0%B5%D1%80%D1%81%D0%B8%D1%82%D0%B5%D1%82\" title=\"\u041a\u043e\u043f\u0435\u043d\u0433\u0430\u0433\u0435\u043d\u0441\u043a\u0438\u0439 \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\">\u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1485_%D0%B3%D0%BE%D0%B4\" title=\"1485 \u0433\u043e\u0434\">1485<\/a>&#160;\u2014 \u0412\u0435\u043d\u0433\u0435\u0440\u0441\u043a\u0438\u0439 \u043a\u043e\u0440\u043e\u043b\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%82%D1%8C%D1%8F%D1%88_I_(%D0%BA%D0%BE%D1%80%D0%BE%D0%BB%D1%8C_%D0%92%D0%B5%D0%BD%D0%B3%D1%80%D0%B8%D0%B8)\" title=\"\u041c\u0430\u0442\u044c\u044f\u0448 I (\u043a\u043e\u0440\u043e\u043b\u044c \u0412\u0435\u043d\u0433\u0440\u0438\u0438)\">\u041c\u0430\u0442\u044c\u044f\u0448 I \u041a\u043e\u0440\u0432\u0438\u043d<\/a> \u0437\u0430\u0445\u0432\u0430\u0442\u0438\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BD%D0%B0\" title=\"\u0412\u0435\u043d\u0430\">\u0412\u0435\u043d\u0443<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1495\" class=\"mw-redirect\" title=\"1495\">1495<\/a>&#160;\u2014 \u043f\u0435\u0440\u0432\u043e\u0435 \u043f\u0438\u0441\u044c\u043c\u0435\u043d\u043d\u043e\u0435 \u0443\u043f\u043e\u043c\u0438\u043d\u0430\u043d\u0438\u0435 \u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B8%D1%81%D0%BA%D0%B8\" title=\"\u0412\u0438\u0441\u043a\u0438\">\u0448\u043e\u0442\u043b\u0430\u043d\u0434\u0441\u043a\u043e\u043c \u0432\u0438\u0441\u043a\u0438<\/a> \u0432 \u043a\u0430\u0437\u043d\u0430\u0447\u0435\u0439\u0441\u043a\u0438\u0445 \u043e\u0442\u0447\u0451\u0442\u0430\u0445 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%BE%D1%82%D0%BB%D0%B0%D0%BD%D0%B4%D0%B8%D1%8F\" title=\"\u0428\u043e\u0442\u043b\u0430\u043d\u0434\u0438\u044f\">\u0428\u043e\u0442\u043b\u0430\u043d\u0434\u0438\u0438<\/a>. \u0412\u0438\u043d\u043e\u043a\u0443\u0440\u043e\u043c \u0431\u044b\u043b \u043c\u043e\u043d\u0430\u0445 \u0414\u0436\u043e\u043d \u041a\u043e\u0440 (John Cor).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1533_%D0%B3%D0%BE%D0%B4\" title=\"1533 \u0433\u043e\u0434\">1533<\/a>&#160;\u2014 \u0441\u043e\u0441\u0442\u043e\u044f\u043b\u0430\u0441\u044c \u043a\u043e\u0440\u043e\u043d\u0430\u0446\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D0%BB%D0%B5%D0%B9%D0%BD,_%D0%90%D0%BD%D0%BD%D0%B0\" title=\"\u0411\u043e\u043b\u0435\u0439\u043d, \u0410\u043d\u043d\u0430\">\u0410\u043d\u043d\u044b \u0411\u043e\u043b\u0435\u0439\u043d<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1648_%D0%B3%D0%BE%D0%B4\" title=\"1648 \u0433\u043e\u0434\">1648<\/a>&#160;\u2014 \u0432 \u0445\u043e\u0434\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B3%D0%BB%D0%B8%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D1%80%D0%B5%D0%B2%D0%BE%D0%BB%D1%8E%D1%86%D0%B8%D1%8F\" title=\"\u0410\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0430\u044f \u0440\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u044f\">\u0410\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u043e\u0439 \u0433\u0440\u0430\u0436\u0434\u0430\u043d\u0441\u043a\u043e\u0439 \u0432\u043e\u0439\u043d\u044b<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%80%D0%BC%D0%B8%D1%8F_%D0%BD%D0%BE%D0%B2%D0%BE%D0%B3%D0%BE_%D0%BE%D0%B1%D1%80%D0%B0%D0%B7%D1%86%D0%B0\" title=\"\u0410\u0440\u043c\u0438\u044f \u043d\u043e\u0432\u043e\u0433\u043e \u043e\u0431\u0440\u0430\u0437\u0446\u0430\">\u0432\u043e\u0439\u0441\u043a\u0430 \u043f\u0430\u0440\u043b\u0430\u043c\u0435\u043d\u0442\u0430<\/a> \u0440\u0430\u0437\u0433\u0440\u043e\u043c\u0438\u043b\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%B2%D0%B0%D0%BB%D0%B5%D1%80%D1%8B\" title=\"\u041a\u0430\u0432\u0430\u043b\u0435\u0440\u044b\">\u043a\u0430\u0432\u0430\u043b\u0435\u0440\u043e\u0432<\/a> \u0432 <a href=\"https:\/\/en.wikipedia.org\/wiki\/Battle_of_Maidstone\" class=\"extiw\" title=\"en:Battle of Maidstone\">\u0431\u0438\u0442\u0432\u0435 \u043f\u0440\u0438 \u041c\u0435\u0439\u0434\u0441\u0442\u043e\u043d\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1670_%D0%B3%D0%BE%D0%B4\" title=\"1670 \u0433\u043e\u0434\">1670<\/a>&#160;\u2014 \u043c\u0435\u0436\u0434\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%80%D0%BB_II_(%D0%BA%D0%BE%D1%80%D0%BE%D0%BB%D1%8C_%D0%90%D0%BD%D0%B3%D0%BB%D0%B8%D0%B8)\" title=\"\u041a\u0430\u0440\u043b II (\u043a\u043e\u0440\u043e\u043b\u044c \u0410\u043d\u0433\u043b\u0438\u0438)\">\u0427\u0430\u0440\u043b\u044c\u0437\u043e\u043c II<\/a>, \u043a\u043e\u0440\u043e\u043b\u0451\u043c \u0410\u043d\u0433\u043b\u0438\u0438 \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D1%8E%D0%B4%D0%BE%D0%B2%D0%B8%D0%BA_XIV\" title=\"\u041b\u044e\u0434\u043e\u0432\u0438\u043a XIV\">\u041b\u044e\u0434\u043e\u0432\u0438\u043a\u043e\u043c XIV<\/a>, \u043a\u043e\u0440\u043e\u043b\u0451\u043c \u0424\u0440\u0430\u043d\u0446\u0438\u0438, \u0431\u044b\u043b \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043d \u0441\u0435\u043a\u0440\u0435\u0442\u043d\u044b\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D1%83%D0%B2%D1%80%D1%81%D0%BA%D0%B8%D0%B9_%D0%B4%D0%BE%D0%B3%D0%BE%D0%B2%D0%BE%D1%80\" title=\"\u0414\u0443\u0432\u0440\u0441\u043a\u0438\u0439 \u0434\u043e\u0433\u043e\u0432\u043e\u0440\">\u0414\u0443\u0432\u0440\u0441\u043a\u0438\u0439 \u0434\u043e\u0433\u043e\u0432\u043e\u0440<\/a>, \u043e\u0431\u044a\u0435\u0434\u0438\u043d\u0438\u0432\u0448\u0438\u0439 \u0438\u0445 \u0441\u0442\u0440\u0430\u043d\u044b \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D0%BB%D0%BB%D0%B0%D0%BD%D0%B4%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u0413\u043e\u043b\u043b\u0430\u043d\u0434\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u0433\u0440\u044f\u0434\u0443\u0449\u0435\u0439 \u0432\u043e\u0439\u043d\u0435<\/a> \u043f\u0440\u043e\u0442\u0438\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0_%D0%A1%D0%BE%D0%B5%D0%B4%D0%B8%D0%BD%D1%91%D0%BD%D0%BD%D1%8B%D1%85_%D0%BF%D1%80%D0%BE%D0%B2%D0%B8%D0%BD%D1%86%D0%B8%D0%B9\" title=\"\u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430 \u0421\u043e\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0445 \u043f\u0440\u043e\u0432\u0438\u043d\u0446\u0438\u0439\">\u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0438 \u0421\u043e\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0445 \u043f\u0440\u043e\u0432\u0438\u043d\u0446\u0438\u0439<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1679_%D0%B3%D0%BE%D0%B4\" title=\"1679 \u0433\u043e\u0434\">1679<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%B2%D0%B5%D0%BD%D0%B0%D0%BD%D1%82%D1%81%D0%BA%D0%BE%D0%B5_%D0%B4%D0%B2%D0%B8%D0%B6%D0%B5%D0%BD%D0%B8%D0%B5\" title=\"\u041a\u043e\u0432\u0435\u043d\u0430\u043d\u0442\u0441\u043a\u043e\u0435 \u0434\u0432\u0438\u0436\u0435\u043d\u0438\u0435\">\u041a\u043e\u0432\u0435\u043d\u0430\u043d\u0442\u0441\u043a\u0438\u0435 \u0432\u043e\u0439\u043d\u044b<\/a>: \u0448\u043e\u0442\u043b\u0430\u043d\u0434\u0441\u043a\u0438\u0435 \u043a\u043e\u0432\u0435\u043d\u0430\u043d\u0442\u0435\u0440\u044b \u0440\u0430\u0437\u0433\u0440\u043e\u043c\u0438\u043b\u0438 \u043a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u043a\u0443\u044e \u0430\u0440\u043c\u0438\u044e \u043f\u043e\u0434 \u0440\u0443\u043a\u043e\u0432\u043e\u0434\u0441\u0442\u0432\u043e\u043c <a href=\"https:\/\/en.wikipedia.org\/wiki\/John_Graham,_1st_Viscount_Dundee\" class=\"extiw\" title=\"en:John Graham, 1st Viscount Dundee\">\u0414\u0436\u043e\u043d\u0430 \u0413\u0440\u044d\u0445\u0435\u043c\u0430<\/a> \u0432 <a href=\"https:\/\/en.wikipedia.org\/wiki\/Battle_of_Drumclog\" class=\"extiw\" title=\"en:Battle of Drumclog\">\u0411\u0438\u0442\u0432\u0435 \u043f\u0440\u0438 \u0414\u0440\u0430\u043c\u043a\u043b\u043e\u0433<\/a>.<\/li><\/ul><h3>XVIII \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1725_%D0%B3%D0%BE%D0%B4\" title=\"1725 \u0433\u043e\u0434\">1725<\/a>&#160;\u2014 \u0432 \u0446\u0430\u0440\u0441\u0442\u0432\u043e\u0432\u0430\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%BA%D0%B0%D1%82%D0%B5%D1%80%D0%B8%D0%BD%D0%B0_I\" title=\"\u0415\u043a\u0430\u0442\u0435\u0440\u0438\u043d\u0430 I\">\u0415\u043a\u0430\u0442\u0435\u0440\u0438\u043d\u044b I<\/a> \u0443\u0447\u0440\u0435\u0436\u0434\u0451\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%80%D0%B4%D0%B5%D0%BD_%D0%A1%D0%B2%D1%8F%D1%82%D0%BE%D0%B3%D0%BE_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%B0_%D0%9D%D0%B5%D0%B2%D1%81%D0%BA%D0%BE%D0%B3%D0%BE\" title=\"\u041e\u0440\u0434\u0435\u043d \u0421\u0432\u044f\u0442\u043e\u0433\u043e \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0430 \u041d\u0435\u0432\u0441\u043a\u043e\u0433\u043e\">\u041e\u0440\u0434\u0435\u043d \u0421\u0432\u044f\u0442\u043e\u0433\u043e \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0430 \u041d\u0435\u0432\u0441\u043a\u043e\u0433\u043e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1779_%D0%B3%D0%BE%D0%B4\" title=\"1779 \u0433\u043e\u0434\">1779<\/a>&#160;\u2014 \u0433\u0440\u0435\u0447\u0435\u0441\u043a\u0438\u043c\u0438 \u043f\u043e\u0441\u0435\u043b\u0435\u043d\u0446\u0430\u043c\u0438 \u043e\u0441\u043d\u043e\u0432\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%80%D0%B8%D1%83