\u0441\u0438\">\u0422\u0435\u043d\u043d\u0435\u0441\u0441\u0438<\/a> \u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0442\u0441\u044f 16-\u043c \u0448\u0442\u0430\u0442\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B5%D0%B4%D0%B8%D0%BD%D1%91%D0%BD%D0%BD%D1%8B%D0%B5_%D0%A8%D1%82%D0%B0%D1%82%D1%8B_%D0%90%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B8\" title=\"\u0421\u043e\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0435 \u0428\u0442\u0430\u0442\u044b \u0410\u043c\u0435\u0440\u0438\u043a\u0438\">\u0421\u0428\u0410<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1798_%D0%B3%D0%BE%D0%B4\" title=\"1798 \u0433\u043e\u0434\">1798<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0435<\/a> \u0443\u0447\u0440\u0435\u0436\u0434\u0451\u043d \u0438\u043d\u0441\u0442\u0438\u0442\u0443\u0442 \u0421\u0432\u044f\u0442\u043e\u0439 \u0415\u043a\u0430\u0442\u0435\u0440\u0438\u043d\u044b \u0434\u043b\u044f \u0431\u043b\u0430\u0433\u043e\u0440\u043e\u0434\u043d\u044b\u0445 \u0434\u0435\u0432\u0438\u0446. <\/li><\/ul><h3>XIX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1806\" class=\"mw-redirect\" title=\"1806\">1806<\/a>&#160;\u2014 \u0432 \u0433\u043e\u0440\u043e\u0434\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" class=\"mw-redirect\" title=\"\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0435<\/a> \u0437\u0430\u043b\u043e\u0436\u0435\u043d\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BC%D0%BE%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D0%B8%D0%BD%D1%81%D1%82%D0%B8%D1%82%D1%83%D1%82_(%D0%B7%D0%B4%D0%B0%D0%BD%D0%B8%D0%B5)\" class=\"mw-redirect\" title=\"\u0421\u043c\u043e\u043b\u044c\u043d\u044b\u0439 \u0438\u043d\u0441\u0442\u0438\u0442\u0443\u0442 (\u0437\u0434\u0430\u043d\u0438\u0435)\">\u0437\u0434\u0430\u043d\u0438\u0435 \u0421\u043c\u043e\u043b\u044c\u043d\u043e\u0433\u043e \u0438\u043d\u0441\u0442\u0438\u0442\u0443\u0442\u0430<\/a> (\u0430\u0440\u0445\u0438\u0442\u0435\u043a\u0442\u043e\u0440 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B2%D0%B0%D1%80%D0%B5%D0%BD%D0%B3%D0%B8,_%D0%94%D0%B6%D0%B0%D0%BA%D0%BE%D0%BC%D0%BE\" title=\"\u041a\u0432\u0430\u0440\u0435\u043d\u0433\u0438, \u0414\u0436\u0430\u043a\u043e\u043c\u043e\">\u0414\u0436\u0430\u043a\u043e\u043c\u043e \u041a\u0432\u0430\u0440\u0435\u043d\u0433\u0438<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1816\" class=\"mw-redirect\" title=\"1816\">1816<\/a>&#160;\u2014 \u043a\u043e\u043d\u0441\u0443\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D0%B0%D0%B3%D0%B2%D0%B0%D0%B9\" title=\"\u041f\u0430\u0440\u0430\u0433\u0432\u0430\u0439\">\u041f\u0430\u0440\u0430\u0433\u0432\u0430\u044f<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D0%BE%D1%81%D0%B5_%D0%93%D0%B0%D1%81%D0%BF%D0%B0%D1%80_%D0%A0%D0%BE%D0%B4%D1%80%D0%B8%D0%B3%D0%B5%D1%81_%D0%B4%D0%B5_%D0%A4%D1%80%D0%B0%D0%BD%D1%81%D0%B8%D1%8F\" class=\"mw-redirect\" title=\"\u0425\u043e\u0441\u0435 \u0413\u0430\u0441\u043f\u0430\u0440 \u0420\u043e\u0434\u0440\u0438\u0433\u0435\u0441 \u0434\u0435 \u0424\u0440\u0430\u043d\u0441\u0438\u044f\">\u0425\u043e\u0441\u0435 \u0413\u0430\u0441\u043f\u0430\u0440 \u0420\u043e\u0434\u0440\u0438\u0433\u0435\u0441 \u0434\u0435 \u0424\u0440\u0430\u043d\u0441\u0438\u044f<\/a> \u0441\u0442\u0430\u043b \u041f\u043e\u0441\u0442\u043e\u044f\u043d\u043d\u044b\u043c \u0434\u0438\u043a\u0442\u0430\u0442\u043e\u0440\u043e\u043c \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0438 (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%81%D0%BF%D0%B0%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D1%8F%D0%B7%D1%8B%D0%BA\" title=\"\u0418\u0441\u043f\u0430\u043d\u0441\u043a\u0438\u0439 \u044f\u0437\u044b\u043a\">\u0438\u0441\u043f.<\/a>&#160;Dictador Perpetuo de la Republica), \u0447\u0435\u0440\u0435\u0437 \u0447\u0435\u0442\u044b\u0440\u0435 \u0433\u043e\u0434\u0430 \u043f\u0435\u0440\u0435\u0438\u043c\u0435\u043d\u043e\u0432\u0430\u0432 \u0441\u0432\u043e\u0439 \u043f\u043e\u0441\u0442 \u0432 \u0412\u0435\u0440\u0445\u043e\u0432\u043d\u043e\u0433\u043e \u0434\u0438\u043a\u0442\u0430\u0442\u043e\u0440\u0430 (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%81%D0%BF%D0%B0%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D1%8F%D0%B7%D1%8B%D0%BA\" title=\"\u0418\u0441\u043f\u0430\u043d\u0441\u043a\u0438\u0439 \u044f\u0437\u044b\u043a\">\u0438\u0441\u043f.<\/a>&#160;El Supremo Dictador). \u041d\u0430 \u044d\u0442\u043e\u043c \u043f\u043e\u0441\u0442\u0443 \u0424\u0440\u0430\u043d\u0441\u0438\u044f, \u043e\u0431\u043b\u0430\u0434\u0430\u044f \u043d\u0435\u043e\u0433\u0440\u0430\u043d\u0438\u0447\u0435\u043d\u043d\u043e\u0439 \u0432\u043b\u0430\u0441\u0442\u044c\u044e, \u043d\u0430\u0445\u043e\u0434\u0438\u043b\u0441\u044f \u0434\u043e \u0441\u0432\u043e\u0435\u0439 \u0441\u043c\u0435\u0440\u0442\u0438 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1840_%D0%B3%D0%BE%D0%B4\" title=\"1840 \u0433\u043e\u0434\">1840<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1830\" class=\"mw-redirect\" title=\"1830\">1830<\/a>&#160;\u2014 \u0432 \u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0435 \u0432\u043e\u043a\u0440\u0443\u0433 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BF%D0%B0%D1%81%D0%BE-%D0%9F%D1%80%D0%B5%D0%BE%D0%B1%D1%80%D0%B0%D0%B6%D0%B5%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D1%81%D0%BE%D0%B1%D0%BE%D1%80_(%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3)\" title=\"\u0421\u043f\u0430\u0441\u043e-\u041f\u0440\u0435\u043e\u0431\u0440\u0430\u0436\u0435\u043d\u0441\u043a\u0438\u0439 \u0441\u043e\u0431\u043e\u0440 (\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433)\">\u0421\u043f\u0430\u0441\u043e-\u041f\u0440\u0435\u043e\u0431\u0440\u0430\u0436\u0435\u043d\u0441\u043a\u043e\u0433\u043e \u0441\u043e\u0431\u043e\u0440\u0430<\/a> \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0430 \u043e\u0433\u0440\u0430\u0434\u0430 \u0438\u0437 \u0442\u0443\u0440\u0435\u0446\u043a\u0438\u0445 \u043e\u0440\u0443\u0434\u0438\u0439&#160;\u2014 \u0442\u0440\u043e\u0444\u0435\u0435\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D1%83%D1%81%D1%81%D0%BA%D0%BE-%D1%82%D1%83%D1%80%D0%B5%D1%86%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0_(1828%E2%80%941829)\" title=\"\u0420\u0443\u0441\u0441\u043a\u043e-\u0442\u0443\u0440\u0435\u0446\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430 (1828\u20141829)\">\u0440\u0443\u0441\u0441\u043a\u043e-\u0442\u0443\u0440\u0435\u0446\u043a\u043e\u0439 \u0432\u043e\u0439\u043d\u044b 1828\u20141829 \u0433\u043e\u0434\u043e\u0432<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1831\" class=\"mw-redirect\" title=\"1831\">1831<\/a>&#160;\u2014 \u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u0439 \u0438\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u0442\u0435\u043b\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81,_%D0%94%D0%B6%D0%BE%D0%BD\" title=\"\u0420\u043e\u0441\u0441, \u0414\u0436\u043e\u043d\">\u0414\u0436\u043e\u043d \u0420\u043e\u0441\u0441<\/a> \u043e\u0442\u043a\u0440\u044b\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%B2%D0%B5%D1%80%D0%BD%D1%8B%D0%B9_%D0%BC%D0%B0%D0%B3%D0%BD%D0%B8%D1%82%D0%BD%D1%8B%D0%B9_%D0%BF%D0%BE%D0%BB%D1%8E%D1%81\" title=\"\u0421\u0435\u0432\u0435\u0440\u043d\u044b\u0439 \u043c\u0430\u0433\u043d\u0438\u0442\u043d\u044b\u0439 \u043f\u043e\u043b\u044e\u0441\">\u0441\u0435\u0432\u0435\u0440\u043d\u044b\u0439 \u043c\u0430\u0433\u043d\u0438\u0442\u043d\u044b\u0439 \u043f\u043e\u043b\u044e\u0441<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1838_%D0%B3%D0%BE%D0%B4\" title=\"1838 \u0433\u043e\u0434\">1838<\/a>&#160;\u2014 \u0434\u0435\u044f\u0442\u0435\u043b\u0438 \u043a\u0443\u043b\u044c\u0442\u0443\u0440\u044b \u0432\u044b\u043a\u0443\u043f\u0438\u043b\u0438 \u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D0%B5%D0%BF%D0%BE%D1%81%D1%82%D0%BD%D0%BE%D0%B5_%D0%BF%D1%80%D0%B0%D0%B2%D0%BE\" title=\"\u041a\u0440\u0435\u043f\u043e\u0441\u0442\u043d\u043e\u0435 \u043f\u0440\u0430\u0432\u043e\">\u043a\u0440\u0435\u043f\u043e\u0441\u0442\u043d\u043e\u0439 \u043d\u0435\u0432\u043e\u043b\u0438<\/a> \u0443\u043a\u0440\u0430\u0438\u043d\u0441\u043a\u043e\u0433\u043e \u0445\u0443\u0434\u043e\u0436\u043d\u0438\u043a\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B5%D0%B2%D1%87%D0%B5%D0%BD%D0%BA%D0%BE,_%D0%A2%D0%B0%D1%80%D0%B0%D1%81_%D0%93%D1%80%D0%B8%D0%B3%D0%BE%D1%80%D1%8C%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0428\u0435\u0432\u0447\u0435\u043d\u043a\u043e, \u0422\u0430\u0440\u0430\u0441 \u0413\u0440\u0438\u0433\u043e\u0440\u044c\u0435\u0432\u0438\u0447\">\u0422\u0430\u0440\u0430\u0441\u0430 \u0428\u0435\u0432\u0447\u0435\u043d\u043a\u043e<\/a><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1858\" class=\"mw-redirect\" title=\"1858\">1858<\/a>&#160;\u2014 \u0438\u0437\u0433\u043e\u0442\u043e\u0432\u043b\u0435\u043d\u044b \u043f\u0435\u0440\u0432\u044b\u0435 \u043a\u0430\u043d\u0430\u0434\u0441\u043a\u0438\u0435 \u043c\u043e\u043d\u0435\u0442\u044b.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1860_%D0%B3%D0%BE%D0%B4\" title=\"1860 \u0433\u043e\u0434\">1860<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B8%D0%BD%D1%86_%D0%A3%D1%8D%D0%BB%D1%8C%D1%81%D0%BA%D0%B8%D0%B9\" title=\"\u041f\u0440\u0438\u043d\u0446 \u0423\u044d\u043b\u044c\u0441\u043a\u0438\u0439\">\u041f\u0440\u0438\u043d\u0446 \u0423\u044d\u043b\u044c\u0441\u043a\u0438\u0439<\/a> \u0410\u043b\u044c\u0431\u0435\u0440\u0442 \u042d\u0434\u0443\u0430\u0440\u0434 (\u0431\u0443\u0434\u0443\u0449\u0438\u0439 \u043a\u043e\u0440\u043e\u043b\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D0%B4%D1%83%D0%B0%D1%80%D0%B4_VII\" title=\"\u042d\u0434\u0443\u0430\u0440\u0434 VII\">\u042d\u0434\u0443\u0430\u0440\u0434 VII<\/a>) \u0437\u0430\u043b\u043e\u0436\u0438\u043b \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%82%D1%82%D0%B0%D0%B2%D0%B0\" title=\"\u041e\u0442\u0442\u0430\u0432\u0430\">\u041e\u0442\u0442\u0430\u0432\u0435<\/a> \u0444\u0443\u043d\u0434\u0430\u043c\u0435\u043d\u0442 \u0437\u0434\u0430\u043d\u0438\u044f \u043a\u0430\u043d\u0430\u0434\u0441\u043a\u043e\u0433\u043e \u043f\u0430\u0440\u043b\u0430\u043c\u0435\u043d\u0442\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1862_%D0%B3%D0%BE%D0%B4\" title=\"1862 \u0433\u043e\u0434\">1862<\/a>&#160;\u2014 \u043d\u0430 \u0432\u0441\u0435\u0439 \u0442\u0435\u0440\u0440\u0438\u0442\u043e\u0440\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B5%D0%B4%D0%B8%D0%BD%D1%91%D0%BD%D0%BD%D1%8B%D0%B5_%D0%A8%D1%82%D0%B0%D1%82%D1%8B_%D0%90%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B8\" title=\"\u0421\u043e\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0435 \u0428\u0442\u0430\u0442\u044b \u0410\u043c\u0435\u0440\u0438\u043a\u0438\">\u0421\u0428\u0410<\/a> \u0437\u0430\u043f\u0440\u0435\u0449\u0435\u043d\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B0%D0%B1%D1%81%D1%82%D0%B2%D0%BE\" title=\"\u0420\u0430\u0431\u0441\u0442\u0432\u043e\">\u0440\u0430\u0431\u0441\u0442\u0432\u043e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1863\" class=\"mw-redirect\" title=\"1863\">1863<\/a>&#160;\u2014 \u043f\u0435\u0440\u0432\u044b\u0439 \u0443\u043f\u0440\u0430\u0432\u043b\u044f\u0435\u043c\u044b\u0439 \u043f\u043e\u043b\u0451\u0442 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B8%D1%80%D0%B8%D0%B6%D0%B0%D0%B1%D0%BB%D1%8C\" title=\"\u0414\u0438\u0440\u0438\u0436\u0430\u0431\u043b\u044c\">\u0434\u0438\u0440\u0438\u0436\u0430\u0431\u043b\u0435<\/a> \u00ab<a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%90%D1%8D%D1%80%D0%BE%D0%BD-1&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0410\u044d\u0440\u043e\u043d-1 (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0410\u044d\u0440\u043e\u043d-1<\/a>\u00bb \u0431\u0435\u0437 \u0434\u0432\u0438\u0433\u0430\u0442\u0435\u043b\u044f. \u0414\u0438\u0440\u0438\u0436\u0430\u0431\u043b\u044c \u043c\u043e\u0433 \u043e\u0442\u0440\u044b\u0432\u0430\u0442\u044c\u0441\u044f \u043e\u0442 \u0437\u0435\u043c\u043b\u0438, \u043b\u0435\u0442\u0435\u0442\u044c \u043f\u0440\u043e\u0442\u0438\u0432 \u0432\u0435\u0442\u0440\u0430 \u0438 \u0441\u043e\u0432\u0435\u0440\u0448\u0430\u0442\u044c \u043f\u043b\u0430\u0432\u043d\u0443\u044e \u043f\u043e\u0441\u0430\u0434\u043a\u0443. \u042d\u0442\u043e \u043f\u0440\u043e\u0438\u0441\u0445\u043e\u0434\u0438\u043b\u043e \u0437\u0430 \u0441\u0447\u0451\u0442 \u043f\u0435\u0440\u0435\u043c\u0435\u0449\u0435\u043d\u0438\u044f \u043a\u0430\u0431\u0438\u043d\u044b \u0438 \u043d\u0430\u043a\u043b\u043e\u043d\u0430 \u0434\u0438\u0440\u0438\u0436\u0430\u0431\u043b\u044f \u0432\u0432\u0435\u0440\u0445 \u0438\u043b\u0438 \u0432\u043d\u0438\u0437. \u041f\u043e\u043b\u0451\u0442 \u0441\u043e\u0432\u0435\u0440\u0448\u0430\u043b\u0441\u044f \u0437\u0430 \u0441\u0447\u0451\u0442 \u0441\u0431\u0440\u043e\u0441\u0430 \u0431\u0430\u043b\u043b\u0430\u0441\u0442\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1867_%D0%B3%D0%BE%D0%B4\" title=\"1867 \u0433\u043e\u0434\">1867<\/a><ul><li>\u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430\u044f \u0438\u043c\u043f\u0435\u0440\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u0438\u043c\u043f\u0435\u0440\u0438\u0438<\/a> \u0432\u0432\u0435\u0434\u0451\u043d \u0438\u043d\u0441\u0442\u0438\u0442\u0443\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B8%D1%80%D0%BE%D0%B2%D0%BE%D0%B9_%D1%81%D1%83%D0%B4%D1%8C%D1%8F\" title=\"\u041c\u0438\u0440\u043e\u0432\u043e\u0439 \u0441\u0443\u0434\u044c\u044f\">\u043c\u0438\u0440\u043e\u0432\u044b\u0445 \u0441\u0443\u0434\u0435\u0439<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%BE%D1%80%D0%BE%D0%BD%D1%82%D0%BE\" title=\"\u0422\u043e\u0440\u043e\u043d\u0442\u043e\">\u0422\u043e\u0440\u043e\u043d\u0442\u043e<\/a> \u043f\u0440\u043e\u0432\u043e\u0437\u0433\u043b\u0430\u0448\u0451\u043d \u0441\u0442\u043e\u043b\u0438\u0446\u0435\u0439 \u043a\u0430\u043d\u0430\u0434\u0441\u043a\u043e\u0439 \u043f\u0440\u043e\u0432\u0438\u043d\u0446\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%BD%D1%82%D0%B0%D1%80%D0%B8%D0%BE\" title=\"\u041e\u043d\u0442\u0430\u0440\u0438\u043e\">\u041e\u043d\u0442\u0430\u0440\u0438\u043e<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1868_%D0%B3%D0%BE%D0%B4\" title=\"1868 \u0433\u043e\u0434\">1868<\/a>&#160;\u2014 \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%BE%D0%BB%D0%B3%D0%B8%D0%B9_%D0%BC%D0%B0%D1%80%D1%88_%D0%BD%D0%B0%D0%B2%D0%B0%D1%85%D0%BE\" title=\"\u0414\u043e\u043b\u0433\u0438\u0439 \u043c\u0430\u0440\u0448 \u043d\u0430\u0432\u0430\u0445\u043e\">\u0434\u043e\u0433\u043e\u0432\u043e\u0440 \u0411\u043e\u0441\u043a\u0435-\u0420\u0435\u0434\u043e\u043d\u0434\u043e<\/a>, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u0440\u0435\u0433\u0443\u043b\u0438\u0440\u043e\u0432\u0430\u043b \u0441\u0443\u0434\u044c\u0431\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D0%B2%D0%B0%D1%85%D0%BE_(%D0%BD%D0%B0%D1%80%D0%BE%D0%B4)\" title=\"\u041d\u0430\u0432\u0430\u0445\u043e (\u043d\u0430\u0440\u043e\u0434)\">\u043d\u0430\u0432\u0430\u0445\u043e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1869\" class=\"mw-redirect\" title=\"1869\">1869<\/a><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B5%D0%B4%D0%B8%D0%BD%D1%91%D0%BD%D0%BD%D1%8B%D0%B5_%D0%A8%D1%82%D0%B0%D1%82%D1%8B_%D0%90%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B8\" title=\"\u0421\u043e\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0435 \u0428\u0442\u0430\u0442\u044b \u0410\u043c\u0435\u0440\u0438\u043a\u0438\">\u0410\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0439<\/a> \u0438\u0437\u043e\u0431\u0440\u0435\u0442\u0430\u0442\u0435\u043b\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D0%B4%D0%B8%D1%81%D0%BE%D0%BD,_%D0%A2%D0%BE%D0%BC%D0%B0%D1%81_%D0%90%D0%BB%D0%B2%D0%B0\" title=\"\u042d\u0434\u0438\u0441\u043e\u043d, \u0422\u043e\u043c\u0430\u0441 \u0410\u043b\u0432\u0430\">\u0422\u043e\u043c\u0430\u0441 \u0410\u043b\u0432\u0430 \u042d\u0434\u0438\u0441\u043e\u043d<\/a> \u043f\u043e\u043b\u0443\u0447\u0438\u043b \u043f\u0435\u0440\u0432\u044b\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%82%D0%B5%D0%BD%D1%82\" title=\"\u041f\u0430\u0442\u0435\u043d\u0442\">\u043f\u0430\u0442\u0435\u043d\u0442<\/a> \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%AD%D0%BB%D0%B5%D0%BA%D1%82%D1%80%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D0%B9_%D1%81%D1%87%D1%91%D1%82%D1%87%D0%B8%D0%BA_%D0%B3%D0%BE%D0%BB%D0%BE%D1%81%D0%BE%D0%B2_%D0%BD%D0%B0_%D0%B2%D1%8B%D0%B1%D0%BE%D1%80%D0%B0%D1%85&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u042d\u043b\u0435\u043a\u0442\u0440\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0441\u0447\u0451\u0442\u0447\u0438\u043a \u0433\u043e\u043b\u043e\u0441\u043e\u0432 \u043d\u0430 \u0432\u044b\u0431\u043e\u0440\u0430\u0445 (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u044d\u043b\u0435\u043a\u0442\u0440\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0440\u0435\u0433\u0438\u0441\u0442\u0440\u0430\u0442\u043e\u