%B4%D0%B8%D0%B2%D0%BE%D1%81%D1%82%D0%BE%D0%BA\" title=\"\u0412\u043b\u0430\u0434\u0438\u0432\u043e\u0441\u0442\u043e\u043a\">\u0412\u043b\u0430\u0434\u0438\u0432\u043e\u0441\u0442\u043e\u043a<\/a>, \u043e\u0434\u043d\u0430 \u0438\u0437 \u0441\u0430\u043c\u044b\u0445 \u043f\u0440\u043e\u0442\u044f\u0436\u0451\u043d\u043d\u044b\u0445 \u0432 \u043c\u0438\u0440\u0435. \u0412 \u0442\u0435 \u0432\u0440\u0435\u043c\u0435\u043d\u0430 \u043f\u0435\u0440\u0435\u043b\u0451\u0442\u044b \u0441\u043e\u0432\u0435\u0440\u0448\u0430\u043b\u0438\u0441\u044c \u0441 \u043f\u0440\u043e\u043c\u0435\u0436\u0443\u0442\u043e\u0447\u043d\u044b\u043c\u0438 \u043f\u043e\u0441\u0430\u0434\u043a\u0430\u043c\u0438 \u0437\u0430 4 \u0441\u0443\u0442\u043e\u043a.<\/li><li>\u0421\u0432\u0430\u0434\u044c\u0431\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B0%D0%BF%D0%BB%D0%B8%D0%BD,_%D0%A7%D0%B0%D1%80%D0%BB%D1%8C%D0%B7\" title=\"\u0427\u0430\u043f\u043b\u0438\u043d, \u0427\u0430\u0440\u043b\u044c\u0437\">\u0427\u0430\u0440\u043b\u0438 \u0427\u0430\u043f\u043b\u0438\u043d\u0430<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D0%B4%D0%B4%D0%B0%D1%80,_%D0%9F%D0%BE%D0%BB%D0%B5%D1%82%D1%82\" title=\"\u0413\u043e\u0434\u0434\u0430\u0440, \u041f\u043e\u043b\u0435\u0442\u0442\">\u041f\u043e\u043b\u0435\u0442\u0442 \u0413\u043e\u0434\u0434\u0430\u0440<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1938\" class=\"mw-redirect\" title=\"1938\">1938<\/a>&#160;\u2014 \u0432\u044b\u0448\u0435\u043b \u043f\u0435\u0440\u0432\u044b\u0439 \u043d\u043e\u043c\u0435\u0440 \u0436\u0443\u0440\u043d\u0430\u043b\u0430 \u043a\u043e\u043c\u0438\u043a\u0441\u043e\u0432 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/Action_Comics\" title=\"Action Comics\">Action Comics<\/a>\u00bb, \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u043c \u043f\u043e\u044f\u0432\u0438\u043b\u0441\u044f \u0441\u0430\u043c\u044b\u0439 \u0437\u043d\u0430\u043c\u0435\u043d\u0438\u0442\u044b\u0439 \u0433\u0435\u0440\u043e\u0439 \u043a\u043e\u043c\u0438\u043a\u0441\u043e\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%83%D0%BF%D0%B5%D1%80%D0%BC%D0%B5%D0%BD\" title=\"\u0421\u0443\u043f\u0435\u0440\u043c\u0435\u043d\">\u0421\u0443\u043f\u0435\u0440\u043c\u0435\u043d<\/a>. \u0416\u0443\u0440\u043d\u0430\u043b \u0441\u0442\u043e\u0438\u043b \u00a210, \u043a 1995 \u0441\u043e\u0445\u0440\u0430\u043d\u0438\u0432\u0448\u0438\u0435\u0441\u044f \u044d\u043a\u0437\u0435\u043c\u043f\u043b\u044f\u0440\u044b \u043f\u0440\u043e\u0434\u0430\u0432\u0430\u043b\u0438\u0441\u044c \u043f\u043e \u0446\u0435\u043d\u0435 \u0441\u0432\u044b\u0448\u0435 $75 000. \u0410\u0432\u0442\u043e\u0440\u043e\u043c \u043f\u0440\u0438\u043a\u043b\u044e\u0447\u0435\u043d\u0438\u0439 \u0421\u0443\u043f\u0435\u0440\u043c\u0435\u043d\u0430 \u0431\u044b\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B8%D0%B3%D0%B5%D0%BB,_%D0%94%D0%B6%D0%B5%D1%80%D1%80%D0%B8\" title=\"\u0421\u0438\u0433\u0435\u043b, \u0414\u0436\u0435\u0440\u0440\u0438\">\u0414\u0436\u0435\u0440\u0440\u0438 \u0421\u0438\u0433\u0435\u043b<\/a> (Jerome \u00abJerry\u00bb Siegel), \u0430 \u0445\u0443\u0434\u043e\u0436\u043d\u0438\u043a\u043e\u043c&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D1%83%D1%81%D1%82%D0%B5%D1%80,_%D0%94%D0%B6%D0%BE\" title=\"\u0428\u0443\u0441\u0442\u0435\u0440, \u0414\u0436\u043e\">\u0414\u0436\u043e \u0428\u0443\u0441\u0442\u0435\u0440<\/a> (Joe Shuster).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1946_%D0%B3%D0%BE%D0%B4\" title=\"1946 \u0433\u043e\u0434\">1946<\/a>&#160;\u2014 \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u0432 \u0411\u0440\u0438\u0442\u0430\u043d\u0438\u0438 \u0432\u044b\u0434\u0430\u043d\u044b \u0442\u0435\u043b\u0435\u0432\u0438\u0437\u0438\u043e\u043d\u043d\u044b\u0435 \u043b\u0438\u0446\u0435\u043d\u0437\u0438\u0438; \u043e\u043d\u0438 \u0441\u0442\u043e\u044f\u0442 \u00a32.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1948_%D0%B3%D0%BE%D0%B4\" title=\"1948 \u0433\u043e\u0434\">1948<\/a>&#160;\u2014 \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u0432 \u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0438 \u0434\u043e\u0441\u0442\u0430\u0432\u043a\u0443 \u0430\u0432\u0438\u0430\u043f\u043e\u0447\u0442\u044b \u0432\u0435\u0440\u0442\u043e\u043b\u0451\u0442\u0430\u043c\u0438 \u043d\u0430\u0447\u0430\u043b\u0430 \u0432\u044b\u043f\u043e\u043b\u043d\u044f\u0442\u044c \u0444\u0438\u0440\u043c\u0430 \u00ab\u0411\u0440\u0438\u0442\u0438\u0448 \u042e\u0440\u043e\u043f\u0438\u044d\u043d \u042d\u0440\u0443\u044d\u0439\u0437\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1950_%D0%B3%D0%BE%D0%B4\" title=\"1950 \u0433\u043e\u0434\">1950<\/a><ul><li>\u0424\u0438\u0440\u043c\u0430 \u0433\u0440\u0430\u043c\u0437\u0430\u043f\u0438\u0441\u0438 \u00abDecca Records\u00bb \u0432\u044b\u043f\u0443\u0441\u0442\u0438\u043b\u0430 \u043f\u0435\u0440\u0432\u0443\u044e \u0432 \u043c\u0438\u0440\u0435 \u043f\u043b\u0430\u0441\u0442\u0438\u043d\u043a\u0443 \u043d\u0430 33 \u20443 \u043e\u0431\/\u043c\u0438\u043d.<\/li><li>\u041f\u0435\u0440\u0432\u044b\u0439 \u043f\u043e\u043b\u0451\u0442 \u0441\u0430\u043c\u043e\u043b\u0451\u0442\u0430 \u0414\u0443\u0433\u043b\u0430\u0441 \u04102D-1 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%A1%D0%BA%D0%B0%D0%B9%D1%88%D0%B0%D1%80%D0%BA&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0421\u043a\u0430\u0439\u0448\u0430\u0440\u043a (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0421\u043a\u0430\u0439\u0448\u0430\u0440\u043a<\/a>\u00bb.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1955_%D0%B3%D0%BE%D0%B4\" title=\"1955 \u0433\u043e\u0434\">1955<\/a>&#160;\u2014 \u0443\u0442\u0432\u0435\u0440\u0436\u0434\u0451\u043d \u044d\u0441\u043a\u0438\u0437\u043d\u044b\u0439 \u043f\u0440\u043e\u0435\u043a\u0442 \u0432\u0435\u0440\u0442\u043