pedia.org\/wiki\/%D0%9D%D0%BE%D0%B1%D0%B5%D0%BB%D0%B5%D0%B2%D1%81%D0%BA%D0%B0%D1%8F_%D0%BF%D1%80%D0%B5%D0%BC%D0%B8%D1%8F_%D0%BF%D0%BE_%D0%BB%D0%B8%D1%82%D0%B5%D1%80%D0%B0%D1%82%D1%83%D1%80%D0%B5\" title=\"\u041d\u043e\u0431\u0435\u043b\u0435\u0432\u0441\u043a\u0430\u044f \u043f\u0440\u0435\u043c\u0438\u044f \u043f\u043e \u043b\u0438\u0442\u0435\u0440\u0430\u0442\u0443\u0440\u0435\">\u041d\u043e\u0431\u0435\u043b\u0435\u0432\u0441\u043a\u0430\u044f \u043f\u0440\u0435\u043c\u0438\u044f \u043f\u043e \u043b\u0438\u0442\u0435\u0440\u0430\u0442\u0443\u0440\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1966\" class=\"mw-redirect\" title=\"1966\">1966<\/a><ul><li>\u041f\u043e \u043a\u0438\u0442\u0430\u0439\u0441\u043a\u043e\u043c\u0443 \u043d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u043e\u043c\u0443 \u0440\u0430\u0434\u0438\u043e \u0437\u0430\u0447\u0438\u0442\u0430\u043d\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B0%D1%86%D0%B7%D1%8B%D0%B1%D0%B0%D0%BE\" title=\"\u0414\u0430\u0446\u0437\u044b\u0431\u0430\u043e\">\u0434\u0430\u0446\u0437\u044b\u0431\u0430\u043e<\/a>, \u043f\u0440\u0438\u0437\u044b\u0432\u0430\u044e\u0449\u0435\u0435 \u043a \u0431\u043e\u0440\u044c\u0431\u0435 \u043f\u0440\u043e\u0442\u0438\u0432 \u0431\u0443\u0440\u0436\u0443\u0430\u0437\u0438\u0438, \u0441 \u0447\u0435\u0433\u043e \u043d\u0430\u0447\u0430\u043b\u0430\u0441\u044c \u043c\u0430\u0441\u0441\u043e\u0432\u0430\u044f \u043a\u0430\u043c\u043f\u0430\u043d\u0438\u044f \u0440\u0435\u043f\u0440\u0435\u0441\u0441\u0438\u0439 \u043f\u0440\u043e\u0442\u0438\u0432 \u0438\u043d\u0442\u0435\u043b\u043b\u0438\u0433\u0435\u043d\u0446\u0438\u0438.<\/li><li>\u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BD%D0%B0%D0%B4%D0%B0\" title=\"\u041a\u0430\u043d\u0430\u0434\u0430\">\u041a\u0430\u043d\u0430\u0434\u0435<\/a> \u0441\u043e\u0441\u0442\u043e\u044f\u043b\u0430\u0441\u044c \u043f\u0435\u0440\u0432\u0430\u044f \u0442\u0440\u0430\u043d\u0441\u04